import React from "react";

function NameButtons(props) {
    if (props.name === "" ){
        return (
            <div id="NameButtons">
                <p>Welcome to Dream Game. Please select your name:</p>
                <button onClick={() => props.playerJoin("Ethan")}>Ethan</button>
                <button onClick={() => props.playerJoin("Cole")}>Cole</button>
                <button onClick={() => props.playerJoin("Nathan")}>Nathan</button>
                <button onClick={() => props.playerJoin("Oobie")}>Oobie</button>
                <button onClick={() => props.playerJoin("Devon")}>Devon</button>
                <button onClick={() => props.playerJoin("Max")}>Max</button>
                <button onClick={() => props.playerJoin("Mitch")}>Mitch</button>
                <button onClick={() => props.playerJoin("Adam")}>Adam</button>
                <button onClick={() => props.playerJoin("Eric")}>Eric</button>
                <button onClick={() => props.playerJoin("Dylan")}>Dylan</button>
                <button onClick={() => props.playerJoin("Jack")}>Jack</button>
                <button onClick={() => props.playerJoin("Devo")}>Devo</button>
                <button onClick={() => props.playerJoin("Zach")}>Zach</button>
            </div>
        );
    } else if (props.status === "during") {
        return(
            <div id="GuessButtons" className="container">
                <div className="row row-cols-3 flex-nowrap">
                    <div className="col"><button type="button" className="btn btn-primary m-2 w-100 " onClick={() => props.guess("Ethan")}>Ethan</button></div>
                    <div className="col"><button type="button" className="btn btn-primary m-2 w-100 " onClick={() => props.guess("Cole")}>Cole</button></div>
                    <div className="col"><button type="button" className="btn btn-primary m-2 w-100 " onClick={() => props.guess("Nathan")}>Nathan</button></div>
                </div>
                <div className="row row-cols-4 flex-nowrap">
                    <div className="col"><button type="button" className="btn btn-primary m-2 w-100 " onClick={() => props.guess("Oobie")}>Oobie</button></div>
                    <div className="col"><button type="button" className="btn btn-primary m-2 w-100 " onClick={() => props.guess("Devon")}>Devon</button></div>
                    <div className="col"><button type="button" className="btn btn-primary m-2 w-100 " onClick={() => props.guess("Max")}>Max</button></div>
                    <div className="col"><button type="button" className="btn btn-primary m-2 w-100 " onClick={() => props.guess("Mitch")}>Mitch</button></div>
                </div>
                <div className="row row-cols-7 flex-nowrap"> 
                    <div className="col"><button type="button" className="btn btn-primary m-2 w-50 " onClick={() => props.guess("Adam")}>Adam</button></div>
                    <div className="col"><button type="button" className="btn btn-primary m-2 w-100 " onClick={() => props.guess("Eric")}>Eric</button></div>
                    <div className="col"><button type="button" className="btn btn-primary m-2 w-100 " onClick={() => props.guess("Dylan")}>Dylan</button></div>
                    <div className="col"><button type="button" className="btn btn-primary m-2 w-100 " onClick={() => props.guess("Jack")}>Jack</button></div>
                    <div className="col"><button type="button" className="btn btn-primary m-2 w-100 " onClick={() => props.guess("Devo")}>Devo</button></div>
                    <div className="col"><button type="button" className="btn btn-primary m-2 w-100 " onClick={() => props.guess("Zach")}>Zach</button></div>
                </div>  
            </div>
        );
    }  else if (props.status === "guessed") {
        return(
            <div>
                <p>Waiting for others to guess...</p>
            </div>
        );
    }
    else {
        return(
            <div id="ControlButtons">
                <button onClick={() => props.start()}>Start</button>
            </div>
        );
    }
}

export default NameButtons;
